import my_portuguese_certificate from "../../../images/certificates/my-portuguese-certificate.jpg";
import classes from "./Hobbies.module.css";

const Sheet = () => {
  return (
    <div>
      <div>
        <h3 className="mb-3">Learning Languages</h3>
        <div>
          <p>English</p>
          <p>fluent</p>
        </div>
        <div>
          <p>Filipino</p>
          <p>Fluent</p>
        </div>
        <div>
          <a href={my_portuguese_certificate} target="_blank" rel="noreferrer">
            Portuguese
          </a>
          <p>Intermediate</p>
        </div>
        <div>
          <p>Spanish</p>
          <p>Beginner</p>
        </div>
      </div>
      <div>
        <img src="react-app/src/images/me/me_at_bart.png" alt="" />
      </div>
    </div>
  );
};

const Hobbies = () => {
  return (
    <div className={classes.container}>
      <h1 id="hobbies">Hobbies</h1>
      <div className="row container">
        <Sheet />
      </div>
    </div>
  );
};

export default Hobbies;
